import React from 'react'
import Logo from '../img/logo.jpeg';
export default function () {
  return (
    <div class="container">
                <div class="posted-image-container">
                    {/* <!-- Display Posted Images --> */}
                    <img src={Logo} alt="pho" />
                    <div id="postContainer" class="posted-image-container"></div>
                </div>
    </div>
  )
}
